let pi;
let radius = 696340;
// let totalPi = 3.14159265359;
let circumference = 4366813;

function calculateCircumference(){
  let diameter = 2 * radius;
  pi = circumference / diameter;
}


calculateCircumference();

export const valuePi = pi;
export const valueSun = circumference;
